const Pricing = () => {
    const [currentDeposit,setCurrentDeposit] = useState(0)
    const depositArr = [
        {num:1000, 
            content:[
                {
                    name:'Pionner',
                    period: 1,
                    price: 39
                },
                {
                    name:'Adventurer',
                    period: 1,
                    price: 39
                },
                {
                    name:'Explorer',
                    period: 1,
                    price: 39
                },
                {
                    name:'Hero',
                    period: 1,
                    price: 39
                },
            ],
        },
        {num:3000,
            content:[
                {
                    name:'Pionner',
                    period: 1,
                    price: 39
                },
                {
                    name:'Adventurer',
                    period: 1,
                    price: 39
                },
                {
                    name:'Explorer',
                    period: 1,
                    price: 39
                },
                {
                    name:'Hero',
                    period: 1,
                    price: 39
                },
            ]},
        {num:5000, content:[
            {
                name:'Pionner',
                period: 1,
                price: 39
            },
            {
                name:'Adventurer',
                period: 1,
                price: 39
            },
            {
                name:'Explorer',
                period: 1,
                price: 39
            },
            {
                name:'Hero',
                period: 1,
                price: 39
            },
        ]}

    ]
    return(
        <div className='pricing_container'>
            <div className='container'>
                <h2 className='text-white text-center'>Pricing</h2>
                <p className='text-white text-center'>Deposit amount</p>
                <div className='deposit_panel'>
                    {depositArr.map((el,key) => 
                       <div key={key}
                       onClick={() => setCurrentDeposit(key)}
                       className={key === currentDeposit? "active_deposit" :""}>
                        {el.num}$</div>
                    )}
                </div>
                <div className='row container_list_deposit'>


                </div>
            </div>
        </div>
    )
}

export default Pricing
